import React from 'react';

const Navbar = () => {
  return (
    <nav
      className=" navbar navbar-light"
      style={{ backgroundColor: '#e3f2fd' }}
    >
      <div className="container">
        <h2 className="navbar-brand">TodoApp</h2>
        <ul>
          <li nav-item>Home</li>
          <li>SignIn</li>
          <li>SingUp</li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
